import { useLocation } from "react-router-dom";
import "../styles/DogPage.css";
import BaseComponent from "../components/BaseComponent";
import DogItem from "../components/dogItem";

const DogPage = () => {
  const { dog } = useLocation().state;

  // {
  //   "chipNumber":"IOQ831684",
  //   "owner":{
  //   "lastName":"Robinson",
  //   "phoneNumber":"0705823141"
  //          }
  //       },

  return (
    <BaseComponent
      headerContent={
        <div>
          <h1 id="pageTitle">{dog.name}'s information</h1>
        </div>
      }
      mainContent={
        <div className="dogSection">
          <div className="informationSection">Information</div>
          <div>
            {!dog ? <p>Retrieving your dog...</p> : <DogItem dog={dog} className="dog"/>}
          </div>
        </div>
      }
    />
  );
};

export default DogPage;
